Omschrijving:
Inleiding

Achter het hek DIENSTWONING van alleen begane grond met schilddak (1802). 

Omschrijving

Woonhuis uit 1802 dat gebouwd werd bij het landgoed Blauwhuis. Gevel van IJsselsteen met rode strekken. Symmetrische voorgevel bekroond met eenvoudige gootlijst. Naast de woning een houten schuur en daarachter een in eenvoudig metselwerk opgetrokken hok die voor de bescherming van ondergeschikt belang zijn.

Waardering

DIENSTWONING van architectuurhistorisch en stedenbouwkundig belang: 

- vanwege de eenvoudige doch harmonische architectuur; 

- vanwege de oudheidkundige waarde; 

- vanwege de situering aan de Dubbeldamseweg; 

- als karakteristiek en functioneel onderdeel van de begraafplaats.

COURTINE MOLENBOLWERK-GALGEBOLWERK. Courtine met:

- voorliggende gracht ter breedte van pl.m. 35 meter nabij het midden, oplopend tot pl.m. 60 meter nabij de uiteinden;

- ravelijn met ravelijnsgracht ter breedte van pl.m. 10 meter.

Karakteristiek op (beschermde) wierde gelegen en het vlekje Wittewierum markerend, op 13e-eeuwse fundamenten en met gebruikmaking van afkomend materiaal van een vroeg 17e-eeuwse opvolger, in zijn huidige vorm hoofdzakelijk in 1863 in een mengeling van neogotische en Waterstaatsstijl opgetrokken kerkgebouw, met wellicht eveneens 13e-eeuwse grafkelder, en waardevolle 16e-eeuwse en jongere interieuronderdelen; kerk en aangrenzend kerkhof aardig begroeid en, gezien de ouderdom van enkele zerken wellicht sinds de 18e eeuw als zodanig in gebruik zijnd kerkhof zijn beide gelegen op de van omstreeks het begin van onze jaartelling daterende als archeologisch monument beschermde wierde van Wittewierum, ter plaatse van de in 1238 begonnen kerk van de Praemonstratenser abdij Bloemhof; restanten daarvan en van een vroeg-17e-eeuwse opvolgster zijn in en onder het huidige kerkgebouw mogelijk nog bewaard.

Het rechthoekige zaalgebouw uit 1863 is, op 13e-eeuwse fundamenten, hoofdzakelijk opgetrokken uit een rode baksteen, waarbij voor het thans van een blokbepleistering voorziene gedeelte onder de vensters (geheel of gedeeltelijk ?) gebruik is gemaakt van ouder materiaal (van de vroeg-17e-eeuwse voorganger ?); het gebouw wordt gedekt door een met blauwe pannen belegd driezijdig schilddak met pinakeltje aan de achterzijde; (Het opengewerkte houten torentje met siersmeedwerk aan de voorzijde is in de jaren 1940-1945 verloren gegaan). De aan beide zijden met een geblokte hoekpilaster afgezette voorgevel - waarvan de smeedijzeren torentjes eveneens in '40-'45 verloren gingen - heeft boven en te weerszijden van de in een blokbepleisterde middenrisaliet met verzonken velden gevatte ingang met bovenlicht met gietijzeren tracering, een respectievelijk twee spitsboogvensters met dito tracering, eenvoudig geprofileerd getrokken lijstwerk van cementpleister rond deur, vensters en ter afdekking van muurwerk van de voorgevel; waterlijsten; verzonken velden in de blokbepleistering; boven de deur stichtingssteen met het opschrift: GEBOUWD 1863. Kerkvoogden, J.O. ALKEMA, J.F. EISSES, H.G. TUINENGA. Predikant, J. de RAADT.OFFERHAUS.

De beide zijgevels zijn eveneens tot ter hoogte van de vensters van een blokbepleistering voorzien, hebben zes door gemetselde lisenen van elkaar gescheiden spitsboogvensters, waarvan een blind en vijf met gietijzeren tracering; de achtergevel is zonder lisenen maar met twee dito vensters; onderlangs de dakrand een geschulpt houten lijstje met ter hoogte van de staafankers omgekeerde houten obeliskjes.

Het interieur wordt overdekt door een gedrukt gepleisterd tongewelf met gietijzeren roosters, dat rust op een uitkragende geprofileerde stuclijst; de wanden zijn eveneens gepleisterd en verlevendigd door een eenvoudig pleisterprofiel rond de vensters; boven en aan weerszijden van de in een eenvoudige maar verzorgde midden-19e-eeuwse klassicistisch aandoende houten omlijsting met opschrift JES: 2 VERS 3 gevatte ingang zijn respectievelijk een gepleisterd driepasmotief en een blindnis aangebracht.



In het met grijze hardsteen en historische zerken geplaveide interieur met even verhoogd koor zijn van belang:

-de ter hoogte van het koor gelegen wellicht nog 13e-eeuwse of oudere grafkelder met graatgewelf en zwartgrijze plavuizen, voor het geslacht Rengers;

-verschillende 16e-, 17e- en 18e-eeuwse grafzerken, eveneens van het geslacht Rengers;

-een goed gesneden eikehouten dekstuk van een bank (XVIId) met het wapen Rengers-Polman, getorst door twee griffioenen;

-het voor het overige sobere, maar verzorgd vormgegeven midden 19e-eeuwse meubilair, bestaande in een preekstoel met klankbord, twee herenbanken en twee rijen kerkbanken versierd met een enkel neogotisch detail of met bescheiden lofwerk, en genoemde klassicistisch aandoende deuromlijsting.

Op het op de beschermde wierde gelegen, wellicht sinds de 18e eeuw in gebruik zijnde kerkhof liggen en staan een kleine zeventig ten dele moeilijk leesbare zerken; enkele 18e-eeuws, doch het merendeel 19e- en vroeg-20e-eeuws, van een bescheiden tot een meer uitgewerkte vormgeving, en soms afgezet met een eenvoudig gietijzeren hekwerkje.

Karakteristiek op beschermde wierde van omstreeks onze jaartelling gelegen, en ten dele nog gefundeerd op en opgetrokken uit restanten van oudere voorgangers, in zijn huidige vorm hoofdzakelijk uit 1863 daterend, doch in aanleg 13e-eeuws kerkgebouw in de trant van de neogotiek en de Waterstaatsstijl, met aangrenzend het wellicht sinds de 18e eeuw in gebruik zijnde aardig begroeide kerkhof met 18e-eeuwse en jongere grafzerken, van algemeen belang wegens:

-de aanwezigheid van oude fundamenten en hergebruikte materialen die herinneren aan de in 1238 begonnen kerk van de Praemonstratenser abdij Bloemhof en een vroeg 17e-eeuwse opvolgster;

-de waardevolle interieuronderdelen, bestaande uit een wellicht nog 13e-eeuwse grafkelder en verschillende 16e-eeuwse en jongere grafzerken in de kerk voor het geslacht Rengers;

-een goed gesneden bewaard gebleven dekstuk uit XVIId van de Rengers-Polmanbank;

-het overige eenvoudige 19e-eeuwse bij het huidige gebouw uit 1863 behorende kerkmeubilair;

-de relatie met het in de bescherming begrepen kerkhof dat is gelegen op de reeds als archeologisch monument beschermde wierde uit het begin van onze jaartelling en de karakteristieke en het vlekje Wittewierum markerende ligging daarop.

Het in aanleg wellicht sinds de 18e eeuws kerkhof met aardige begroeiing is van algemeen belang wegens:

-de historische relatie met het huidige kerkgebouw, en met voorgangers daarvan;

-de aanwezigheid van een kleine zeventig 18e-, 19e- en vroeg-20e-eeuwse zerken van een eenvoudige maar verzorgde vormgeving, die de herinnering aan vroegere ingezetenen van Wittewierum levend houden;

-de ligging op de reeds als archeologisch monument beschermde wierde uit het begin van onze jaartelling.

16. BASTION IX MET LABORATORIUM. (Dalemwal bij 15)Vol bastion met:

- op het terreplein nabij de rechterflank een bomvrij gemetseld laboratorium, bestaande uit drie overwelfde ruimten, aan terrepleinzijde toegankelijk via twee deuropeningen met ontlastingsbogen; voorts aan voor- en achterzijde enkele kleine ramen;

- voorliggende gracht ter breedte van pl.m. 30 meter.

RAADHUIS ontworpen en gebouwd in de jaren 1928-'30 voor de plattelandsgemeente Usquert door H.P. Berlage volgens diens rationalistisch-architectonische uitgangspunten.

Raadhuis van bescheiden afmetingen, ruim gelegen op een enigszins scheef lopend terrein dat aan de voorzijde wordt begrensd door een muurwerk met eenvoudig stalen hek.

Het twee bouwlagen tellende hoofdzakelijk uit bruinrode baksteen op een onderkeldering opgetrokken en met gewapende betonplaten vlak afgedekte gebouw, heeft een blokvormig aandoende buitenomtrek waarbinnen de ten opzichte van elkaar verspringende en inspringende doch onderling verbonden bouwvolumes zijn gevat. Het gebouw is ontworpen volgens een vaste moduul van 1.10 meter, die is gebaseerd op het kleinste toegepaste constructieve element, te weten de baksteen inclusief de voeg: 5.5 cm x 11 cm x 22 cm. De rechthoekige toren, de ingangspartij met erboven gelegen balkon en de voorgevels van burgemeesterskamer en raadzaal zijn zodanig schuin ten opzichte van de as van het gebouw geprojecteerd, dat zij als belangrijkste representatieve ruimten parallel aan de weg zijn gelegen - waardoor zij de nodige architectonische aandacht krijgen.

De belichting geschiedt door regelmatige reeksen rechthoekige staande en liggende stalen ramen van verschillend formaat, die echter steeds zijn gebaseerd op de genoemde moduul. Tesamen met de zich verjongende toren, geven zij het gebouw een verticaal en daarmee bescheiden expressief karakter.

De uitwendige versiering bestaat hoofdzakelijk in het gebruik van verschillende baksteensoorten, roodbruine, gesinterde en miskleurige baksteen en harde klinkers, metselverbanden, 1-steens en 1/2-steens rollagen boven respectievelijk onder de ramen en een afdekking met grijsblauwe tegels van het opgaande muurwerk.

Bijzondere aandacht is gegeven aan de door een betonnen luifel overdekte ingangspartij met dubbele stalen penduledeuren, waarvoor een brede gemetselde, vier treden tellende stoep ligt die wordt geflankeerd door overhoeks gemetselde bloembakken; voorts aan de toren met uurwerk en opengewerkte smeedijzeren wijzerplaten, dito vlaggestokhouders en windvaan, en het gemeentewapen; verdere sober-decoratieve elementen zijn de vergaarbakken, de brievenbussen links van de ingang, waarboven in gekleurde keramiek uitgevoerde opschriften 'Burgemeester' en 'Secretaris' en, eveneens links van de ingang, een steen met het opschrift: Eerste steen gelegd door Burgemeester T.E. Welt 20-6-1929. De meeste van deze versieringselementen zijn gerealiseerd naar ontwerp van H.P. Berlage.

Het interieur is wat betreft hoofdindeling en inrichting overwegend ongewijzigd gebleven. De begane grond biedt plaats aan ingangspartij met portiersloge en telefooncentrale, hal en wachtkamer, met rechts daarvan de burgemeesterskamer, de secretarie en de kluis, en links daarvan de veldwachterskamer, de keuken, het trappehuis naar de verdieping, de toiletten, de bergplaats voor o.a. rijwielen en het cachot. De verdieping omvat de spreekkamer met klein balkon, de garderobe voor de raad, een hal en een garderobe voor de tribune, met rechts daarvan, de raadzaal met publieke tribune - waarachter, boven de kluis, een via openslaande deuren toegankelijk terras met betonnen pergola - en links daarvan het trappehuis van de toren, de commissiekamer met klein overhoeks balkon, het trappehuis, een tweede bergplaats en, boven de rijwielbergplaats, een plat.

Onlosmakelijk met het interieur verbonden en van belang zijn onder meer de volgende, voor een deel naar ontwerp van Berlage tot stand gekomen, onderdelen: de betegeling van de verkeersruimten, bestaande uit grijze en groenige tinten voor de vloeren en grijs-wit, oranjerood en zwart voor de wanden; de glas-in-lood-ramen met wit en paars kathedraal-glas in entree, hal, trappehuis en lichtkap - in welke laatste de spreuk 'CAVEANT CONSULES' (Dat de manistraat moge waken); de banken, parapluiebakken en kapstokken in beneden- en bovenhal; de betimmeringen met boekenkasten, wandbespanningen, meubilering en lichtornamenten in onder meer de burgemeesterskamer, de commissiekamer en de raadzaal, in welke laatste zich ook de publieke tribune bevinden, en het speciaal voor deze ruimte ontworpen karpet. In de hal op de verdieping is, ter herinnering aan de inwijding van het raadhuis op 27 januari 1930, een groot tegeltableau aangebracht, gemaakt bij de Porceleyne Fles te Delft naar ontwerp van Berlage's dochter A.C. Strasser-Berlage.

Behoudens hoofdarchitect H.P. Berlage en plaatsvervangend architect E.E. Strasser, zijn bij het werk betrokken geweest gemeentearchitect B. Jager als uitvoerend architect; J. Timmer te Zandweer en L. Nanninga te Uithuizen als aannemers; E. Boer te Usquert en H.W. Hamming te Uithuizen voor het schilderwerk; H. Klein te Usquert voor het loodgieterswerk; P. Munting te Roodeschool voor de elektrische installatie; H. Kloose te Groningen voor de centrale verwarming; de N.V. Stoom Meubel- en Timmerfabriek v/h J. Timmer en Zn te Helpman voor de betimmeringen; de N.V. 'L.O.V.' (Labor Omnia Vincit) te Oosterbeek voor de meubilering, de stoffering en de lampen; de firma J.H. Addicks te Amsterdam voor de vervaardiging van torenuurwerk en klokken; de firma N.V. F.W. Braat's Koninklijke Fabriek van Metaalwerken te Delft voor de stalen ramen en deuren en dergelijke.

Sober, doch representatief RAADHUIS, ontworpen en gebouwd in de jaren 1928-'30 voor de Groninger plattelandsgemeente Usquert, van algemeen belang wegens:

- de uitzonderlijke plaats die het inneemt binnen de geschiedenis van de Nederlandse architectuur in het algemeen en die van de moderne raadhuisbouw in het bijzonder;

- de plaats die het inneemt binnen het oeuvre van H.P. Berlage, zowel in ontwerptechnische, als in stilistische zin door de consequent doorgevoerde ontwerpmodule, waarmee Berlage uitdrukking heeft gegeven aan zijn rationalistische visie op de architectuur;

- de stilistische eenheid die exterieur, interieur- en interieuronderdelen tesamen vormen - waarmee het gebouw is te beschouwen als een ontwerpeenheid;

- de toegepaste (moderne) materialen en constructies;

- de opvallende stedebouwkundige situering, waarvan bij het ontwerp op ingenieuze wijze is gebruik gemaakt;

- de hoge mate van oorspronkelijkheid en compleetheid van exterieur, interieur en interieuronderdelen;

- onder meer de genoemde interieuronderdelen, die voor een groot deel zijn gerealiseerd naar ontwerp van H.P. Berlage, en met medewerking van een aantal vooraanstaande firma's en ontwerpers.

Paaltjasker "Vesuvius", gebouwd aan het einde van de 19e eeuw voor Gerrit Baron en Hendrik Schurer door molenbouwer R.W. Dijksma uit Giethoorn ten behoeve van de verveenderij in de omgeving van Elsloo. De tjasker is gerestaureerd in 1977-1978 en bevindt zich thans in het natuurgebied De Stobbepoel in het buurtschap De Ronde nabij Elsloo.

Eenvoudig te demonteren en te verplaatsen houten poldermolentje, bestaande uit een (oudhollands opgehekt) wiekenkruis met vaste borden (vlucht 5 meter) en een houten ton met vijzel, die beide op dezelfde as zijn gemonteerd; de vijzelton wordt rechtstreeks door windkracht aangedreven, dus zonder tussenkomst van een gaand werk, en is gelagerd in een houten raam dat zodanig op een door schoren gesteunde houten paal (molenpaal) is gemonteerd, dat de tjasker vrij op de wind door de maalkom of buitenste ringsloot kan bewegen. Het opgemalen water wordt via de binnenste ringsloot afgevoerd. Gedurende het winterseizoen is de tjasker opgeslagen in een naburige boerderij.

Paaltjasker "Vesuvius" van algemeen belang:-voor de geschiedenis van de industriele archeologie in Nederland, in het bijzonder van die der (demontabele en verplaatsbare) houten tjaskers; -vanwege zijn betekenis voor de ontwikkeling van de Nederlandse bemalingstechniek; -vanwege zijn rol in de 19e-eeuwse verveenderij in Noord-Nederland; -vanwege zijn tegenwoordige landschappelijke betekenis in het natuurgebied De Stobbepoel;
